import PortfolioList from "./components/portfolioList/PortfolioList";
import Works from "./components/works/Works";
import Contact from "./components/contact/Contact";
import "./App.scss";


function App() {

  return (
 <div className="app">
    <Topbar/>
    <div className='sections'>
